// import ProfieLogo6 from "https://www.greencindia.co.in/wp-content/uploads/2020/08/industrial.jpg";



const Home = () => {


    const data = [
        {
            id: 1,
            name: "Imran Khan",
            namee: "Origial account",
            pic: "https://media.mehrnews.com/d/2018/07/13/4/2831167.jpg",
            picc: "https://www.greencindia.co.in/wp-content/uploads/2020/08/industrial.jpg"

        },

        {
            id: 2,
            name: "Sufian Zulfiqar",
            namee: "Origial account",
            pic: "https://www.roxtec.com/optimized/hero-medium/contentassets/b076b4465fb041b181d278c17e6efde5/roxtec_owners.jpg",
            picc: "https://www.greencindia.co.in/wp-content/uploads/2020/08/industrial.jpg",

        },

        {
            id: 3,
            name: "sufians",
            namee: "Not origial account",
            pic: "https://www.costengineering.eu/images/photos/industry-night-2.jpg",
            picc: "https://images.unsplash.com/photo-1511367461989-f85a21fda167?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8cHJvZmlsZXxlbnwwfHwwfHw%3D&w=1000&q=80",

        },

        {
            id: 4,
            name: "sufianz",
            namee: "Origial account",
            pic: "https://constructioncivil.com/wp-content/uploads/2020/11/Industrial-Projects-in-India.jpg",
            picc: "https://www.amg-eng.com/wp-content/uploads/2020/01/ABE-20100830-050-2000x1500.jpg",

        },

        {
            id: 5,
            name: "sufian zulfiqar",
            namee: "Origial account",
            pic: "https://www.amg-eng.com/wp-content/uploads/2020/01/ABE-20100830-050-2000x1500.jpg",
            picc: "https://pub-static.fotor.com/assets/projects/pages/d5bdd0513a0740a8a38752dbc32586d0/fotor-03d1a91a0cec4542927f53c87e0599f6.jpg",

        },

        {
            id: 1,
            name: "sufianss",
            namee: "Origial account",
            pic: "https://www.greencindia.co.in/wp-content/uploads/2020/08/industrial.jpg",
            picc: "https://www.amg-eng.com/wp-content/uploads/2020/01/ABE-20100830-050-2000x1500.jpg",

        },


    ];


    const [heart, setHeart] = useState(0);


    return (
        <>

            <div className="fluid-container">

                <div className="container ">


                    <div className="row border">

                        <div className="col-11">
                            <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/2/2a/Instagram_logo.svg/1024px-Instagram_logo.svg.png" alt="" width={200} height={70} />
                        </div>

                        <div className="col-1 d-flex justify-content-end ">
                            <i class="fa-solid fa-message py-4" style={{ fontSize: "25px" }}></i>
                        </div>

                    </div>

                    {data &&
              data.map((el) => {
                return (



                    <div className="row border my-3 postStyle">


                        <div className="col-12">


                            <div className="row my-2">

                                <div className="col-1 profileLogo">
                                    <img src={el.pic} alt="" />
                                </div>

                                <div className="col-11">
                                    <div className="row">
                                        <div className="col-12">
                                        {el.name}
                                        </div>

                                        <div className="col-12">
                                        {el.namee}
                                        </div>
                                    </div>
                                </div>

                            </div>

                            <div className="row profileImg">

                                <img src={el.picc}className='my-2' alt="" />

                            </div>

                            <div className="row">

                                <div className="col-6">
                                    <div className="row">

                                        <div className="col-1" onClick={()=>setHeart(!heart)}>
                                         { heart == 0 ?  <i class="fa-regular fa-heart"></i> : <i class="fa-solid fa-heart" style={{color:"red   ,...."}} ></i>}

                                        </div>

                                        <div className="col-11">
                                            <i class="fa-solid fa-message"></i>
                                        </div>
                                    </div>
                                </div>

                                <div className="col-6">

                                </div>

                                <div className="col-1">

                                </div>

                                <div className="col-11">
                                </div>

                            </div>

                            <div className="row m-0 p-0">

                                <div className="col-12 m-0 p-0">
                                    <p>see comments</p>
                                </div>

                            </div>



                        </div>


                    </div>


);
})}





                </div>

            </div>

        </>
    )
}

export default Home
